function obtainTables(){$.ajax({url:"https://plantl.api.aina.cf/evalesapi/tables",dataType:"json",success:tableSuccess,error:tableError})}function tableSuccess(a){console.log(a);const e=a.map(a=>[a.email,a.modelName,a.researchGroup,a.paperLink,a.conll_nerc.F1,a.capitel_nerc.F1,a.ud_pos.F1,a.capitel_pos.F1,a.mldoc.F1,a.paws_x.F1,a.sts.Combined,a.sqac.F1,a.xnli.Accuracy]),c=["Rank","Model","Group","Paper","CoNLL-NERC (F1)","CAPITEL-NERC (F1)","UD-POS (F1)","CAPITEL-POS (F1)","MLDoc (F1)","PAWS-X (F1)","STS (Comb.)","SQAC (F1)","XNLI (Acc.)"];let t='<table class="table performanceTable">';t+="<tr>",$(c).each(function(a){t+="<th>"+c[a]}),$(e).each(function(a){t+="<tr>",$(e[a]).each(function(c){switch(c){case 0:t+="<td>"+(a+1);break;case 3:t+='<td><a target="_blank" href='+e[a][c]+'><span class="material-symbols-outlined">open_in_new';break;case 2:t+="<td>"+e[a][c];break;default:t+="<td>"+e[a][c]}})}),$("#leaderboard").html(t)}function tableError(a){console.log(a)}$(document).ready(()=>{obtainTables()});